import React from "react";
import NavBar from "./NavBar";

function Home() {
  return (
    <div>
      <NavBar />
      <div id="homePageDiv">
        <div id="homeRightSide"></div>
        <div id="homeMiddleSide"></div>
        <div id="homeLeftSide"></div>
      </div>
    </div>
  );
}

export default Home;
